import React from 'react'

const P58Question = () => {
    return (
        <div>
            <div>앞서 기억해 둔 <span style={{ color: 'red' }}>복지관의 층별 시설</span>입니다.<br>
            </br>각 시설의 이름과 설명의 빈칸을 채워보세요.</div>
        </div>
    )
}

export default P58Question
